import React, { Component } from 'react'
import Footer from "../layout/Footer";
import Header from "../layout/Header";
import Sidebar from "../layout/Sidebar";

class Centre extends Component {
    constructor(props) {
        super(props);
        this.state ={
            Centre: {
                centreCode:"",
                centreName:""
            }
        };
        this.handleChange = this.handleChange.bind(this);
        this.submitForm = this.centreSubmit.bind(this);
    }
    handleChange(e) {
        let centre = this.state.Centre;
        centre[e.target.name] = e.target.value;
        this.setState({ Centre: centre });
    }

//Submit Form
  submitForm() {
    var thizz = this;
    var myObj = {formData: thizz.state.dataFormOne, rows: thizz.state.rows, emp_details: thizz.state.emp_details, edu_details:thizz.state.edu_details, professional_ref:thizz.state.professional_ref, nominee_details:thizz.state.nominee_details, selfDeclaration:thizz.state.selfDeclaration};
    // Send login request
    axios({
      method: "post",
      url: process.env.REACT_APP_BASE_URL + "/api/wizard",
      data: myObj,

    }).then(function (response) {
        //handle success
        console.log(response);
    }).catch(function (error) {
        //handle error
        console.log(error);

      });
  }

    render() {
        return (
            <>
                <Header />
                <Sidebar />
                <div className="content-wrapper">
                    {/* Content Header (Page header) */}
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row">
                                <div className="col-md-5">

                                    <div className="card card-primary">
                                        <div className="card-header">
                                            <h3 className="card-title">Centre Name {this.state.Centre.centreCode} </h3>
                                        </div>
                                        <form>
                                            <div className="card-body">
